import React from 'react';

import { Container } from './styles';

import photo from '../../assets/profile.png';

const About = () => {
  return (
    <Container>
      <h1>Um pouco sobre mim</h1>
      <img src={photo} alt="Minha foto =D" />
    </Container>
  );
};

export default About;
